import React from "react";

import axios from "axios";

const waypoints = [
  { name: "Espoo", rating: 5 },
  { name: "Helsinki", rating: 4 },
  { name: "Vantaa", rating: 3 },
];

const App = () => {
  const generate = () => {
    const randIndex = Math.floor(Math.random() * waypoints.length);
    const randomizedWaypoint = waypoints[randIndex];

    axios
      .post("http://localhost:3001/api/insert", randomizedWaypoint)
      .then(() => {
        alert("hi");
      })
      .catch((err) => console.log(err));
  };
  return (
    <div>
      <h1>PathBuilder</h1>
      <button onClick={generate}>Generate route!</button>
    </div>
  );
};

export default App;
